import React, { Component } from 'react';
import App from '../App';
import "./News.css";

const News = ({ news }) => {
return (
    <div>
        <div className='cardWrapper'>
      {news.map((news) => (
        <div className="card" key={news.news}>
         <div className="card-body">
            <div className="card-title">
            </div>
            <div className = "card-title">
              <h5 className="URL">{news.news_url}</h5>
            </div>
          </div>
        </div>
      ))}
        </div>
    </div>
  )
      }
export default News;
